      parameters:
        - name: Content-Type
          in: header
          schema:
            type: string
          example: application/json
        - name: channelID
          in: header
          schema:
            type: string
          example: Sodel
        - name: serviceName
          in: header
          schema:
            type: string
          example: sandbox
        - name: uniqueRefNo
          in: header
          schema:
            type: string
          example: '{{$guid}}'
        - name: timestamp
          in: header
          schema:
            type: string
          example: '{{$isoTimestamp}}'
      responses:
        '200':
